    public ListNode sortList(ListNode head){ // 简单的排序
//        if(head.next == null ||head == null)return head; // 顺序问题-顺序就是数字阿
        if(head == null || head.next == null)return head;
        ListNode a = head, b = this.divide(head);
        ListNode ams = sortList(a);
        ListNode bms = sortList(b);
        return mergeLists(ams,bms);
    }


    public ListNode divide(ListNode head){
        if(head.next == null) return head;
        ListNode f = head, s = head, pre = head;
        while(f!=null && f.next !=null){
            f=f.next.next;
            pre = s;
            s = s.next;
        }
        pre.next = null;
        return s;
    }

    // 有序的排序
    public ListNode mergeLists(ListNode a, ListNode b){
        ListNode an = a, bn = b;
        ListNode h = new ListNode(0), tail = h;
        while(an!= null && bn!= null){
            ListNode lt;
            if(an.val < bn.val){
                lt = an;
                an = an.next;
            }else{
                lt = bn;
                bn = bn.next;
            }
            lt.next = tail.next;
            tail.next = lt;
            tail = tail.next;
        }
        if(an!=null)tail.next = an;
        if(bn!=null)tail.next = bn;
        return h.next;
    }

